  String? _fontSize;
  String? _textColor;

  String? get fontSize => _fontSize;
  String? get textColor => _textColor;

  ModuStyl({String? fontSize, String? textColor}) {
    _fontSize = fontSize;
    _textColor = textColor;
  }

  ModuStyl.fromJson(dynamic json) {
    _fontSize = json["fontSize"];
    _textColor = json["textColor"];
  }

  Map<String, dynamic> toJson() {
    var map = <String, dynamic>{};
    map["fontSize"] = _fontSize;
    map["textColor"] = _textColor;
    return map;
  }
}
